import ProductCard from "./ProductCard"

export default function ProductList({ products, onAdd }) {
  return (
    <div style={styles.container} className="product-list">
      {products.map(product => (
        <ProductCard
          key={product.id}
          product={product}
          onAdd={onAdd}
        />
      ))}
    </div>
  )
}

const styles = {
  container: {
    display: "flex",
    gap: "20px",
    flexWrap: "wrap"
  }
}
